import React from 'react';
import './myStyle.css'

function Card() {
  return (
    <div className = 'card'>
    <li>
        <li className= 'numbers' >80 </li>
        <li className= 'cardName'>Sales</li>
    </li>
    </div>
  )
}


export default Card;
